  input: 'TEXT,"F3XA","","We are amending this report in response to your letter dated
    Sept. 25, 2002.  We have corrected the beginning cash balance.  We have now clarified
    disbursements to candidates on line 23 by providing the full name of their campaigns
    and the office sought.  On schedule B you noted that some contributions appear
    to be excessive.  The following contributions to candidates were reported incorrectly,
    but now appear as they were intended and how the recipient committees reported
    them: Carne for Congress $5000 to general on 5/9/02, Chapman for Congress $5000
    general on 5/9/02, Chet Edwards for Congress $3000 general on 5/13/02, Chris Bell
    for Congress $5000 general on 5/9/02, Citizens to elect Rick Larsen $4000 primary
    $1000 to general on 5/13/02, Earl Pomeroy for Congress $5000 general on 5/14/02,
    Friends of Lane Evans $3000 general on 5/13/02, Henry Cuellar for Congress 2002
    $5000 general on 5/9/02, Hilliard for Congress Campaign $5000 runoff on 6/6/02,
    Luther for Congress Volunteer Committee $4000 general on 5/13/02, Phelps for Congress
    $5000 general on 5/13/02, Richard Romero for Congress $5000 general on 6/3/02,
    Thurman for Congress $1000 general on 5/13/02 which was originally reported as
    $2000.  This was a clerical error.  In addition, Tim Ryan for Congress $5000 general
    on 5/9/02.  These changes will also take care of the final point in your letter
    concerning contributions that were noted primary, but made after the primary period
    was over."'
